package com.proutechos.sandbox.radiolivealacarte.server.service.audioServices.recording;public class RecordName {    int withSegments;    String output_name;    public RecordName(int withSegments, String output_name) {        this.withSegments = withSegments;        this.output_name = output_name;    }    public int getWithSegments() {        return withSegments;    }    public void setWithSegments(int withSegments) {        this.withSegments = withSegments;    }    public String getOutput_name() {        return output_name;    }    public void setOutput_name(String output_name) {        this.output_name = output_name;    }    @Override    public String toString() {        return "RecordName{" +                "withSegments=" + withSegments +                ", output_name='" + output_name + '\'' +                '}';    }}